INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 4, 4, 'und', 0, 'HQ Investment & Consulting Vietnam là một công ty tư vấn chuyên cung cấp các giải pháp dành cho lĩnh vực tài chính ngân hàng.\r\n\r\nTư vấn\r\n\r\nTư vấn chiến lược công ty\r\nTư vấn công nghệ\r\nTriển khai công nghệ\r\nCung cấp sản phẩm công nghệ Automatic Trading, ERP, CRM, Accounting\r\nQuản trị dự án và quản trị rủi ro\r\nĐầu tư\r\n\r\nTư vấn sát nhập M&A\r\nĐịnh giá cổ phiếu\r\nNghiên cứu ngành\r\nCung cấp báo cáo về các chiến lược đầu tư chứng khoán, vàng, ngoại tệ và hàng hóa cơ bản\r\nQuản lý danh mục đầu tư\r\nĐào tạo\r\n\r\nĐào tạo nhân lực chất lượng cao\r\nĐào tạo về đầu tư', '', 'plain_text'),
('node', 'article', 0, 5, 5, 'und', 0, 'Quantum Automatic Trading System là một sản phẩm của HQ Investment & Consulting Corporation.\r\n\r\nDownload phiên bản Professional nhấn vào link sau:\r\n\r\nQuantum 2012 Professional Edition\r\nĐể xe hướng dẫn sử dụng nhanh, nhấn vào link sau: Hướng dẫn sử dụng Quantum hoặc vào mục Trợ Giúp để có hướng dẫn chi tiết.\r\n\r\nQuantum là một hệ thống hỗ trợ quyết định  cung cấp các mô hình phân tích, hỗ trợ cho quá trình đầu tư một cách hiệu quả. Hệ thống Quantum cung các chiến lược tự động, đã được tối ưu hóa bởi các chuyên gia trong lĩnh vực toán tài chính. Bên cạnh các chiến lược giao dịch cổ phiếu đã được tự động hóa, Quantum cung cấp một bộ các công cụ hỗ trợ nhằm kiểm tra, đánh giá, mô phỏng quá trình giao dịch.\r\n\r\nVới các thuật toán tối ưu của mình, Quantum ra các quyết định giao dịch đầu tư, tối ưu hóa lợi nhuận lên tới 500% trong 5 năm với nhiều cổ phiếu trên thị trường. Các kết quả giao dịch mô phỏng trên các thuật toán cho thấy Quantum đạt lợi nhuận trung bình hàng năm là 50% so với 24% lợi nhuận trung bình của VNIndex trong giai đoạn 2000 – 2012.\r\n\r\nSản phẩm hiện đang được triển khai sử dụng tại các quỹ đầu tư và các công ty tài chính lớn tại Việt Nam.\r\n\r\nĐể sử dụng được chương trình, người dùng phải được cấp một account chứng thực bởi HQ Corporation.', '', 'full_html'),
